    render() {
        return (
            <Fragment>
                < Style />
                <div className="home">
                    <header>
                        <form action="" id="to-do-form">
                            <input type="text" placeholder="Enter Text" />
                            <button type="submit">Add</button>
                        </form>
                    </header>
                </div>
            </Fragment>
        )
    }
}

export default Home;
